function ToDoList ({Todolist}) {

    console.log(Todolist)
    return(
        <ul className="TodoList">
            {Todolist.map((todo) => (
                <ToDoListItem todo={todo} key={todo.id}/>
            ))}
            
        </ul>
    );
}

export default ToDoList
